    const [todo, setTodo] = useState<Item[]>([{
        id: 1,
        text: 'first task',
        completed: true,
    }]);

    return (
        <div className="main-container">
            <h1>To-Do List</h1>
            <ShowItems items={todo} />
            <div>
                <label>
                    <input></input>
                    <button>Add</button>
                </label>
            </div>
        </div>
    );
};
